    getCorrelation(x, y) {
        var shortestArrayLength = 0;
        if (x.length == y.length) shortestArrayLength = x.length;
        else if (x.length > y.length) shortestArrayLength = y.length;
        else shortestArrayLength = x.length;
        var xy = [];
        var x2 = [];
        var y2 = [];
        for(var i = 0; i < shortestArrayLength; i++){
            xy.push(x[i] * y[i]);
            x2.push(x[i] * x[i]);
            y2.push(y[i] * y[i]);
        }
        var sum_x = 0;
        var sum_y = 0;
        var sum_xy = 0;
        var sum_x2 = 0;
        var sum_y2 = 0;
        for(var i = 0; i < shortestArrayLength; i++){
            sum_x += x[i];
            sum_y += y[i];
            sum_xy += xy[i];
            sum_x2 += x2[i];
            sum_y2 += y2[i];
        }
        var step1 = shortestArrayLength * sum_xy - sum_x * sum_y;
        var step2 = shortestArrayLength * sum_x2 - sum_x * sum_x;
        var step3 = shortestArrayLength * sum_y2 - sum_y * sum_y;
        var step4 = Math.sqrt(step2 * step3);
        var answer = step1 / step4;
        return answer;
    }
    getEvenlySpacedPoints(path, numPoints = 100) {
        const totalLength = path.reduce((length, point, index)=>{
            if (index > 0) {
                const prevPoint = path[index - 1];
                const deltaX = point.x - prevPoint.x;
                const deltaY = point.y - prevPoint.y;
                length += Math.sqrt(deltaX * deltaX + deltaY * deltaY);
            }
            return length;
        }, 0);
        const segmentLength = totalLength / (numPoints - 1);
        let currentLength = 0;
        let currentPointIndex = 0;
        const evenlySpacedPoints = [
            path[0]
        ];
        let lastPoint = null;
        for(let i = 1; i < numPoints - 1; i++){
            const targetLength = i * segmentLength;
            while(currentLength < targetLength){
                const startPoint = lastPoint ? lastPoint : path[currentPointIndex];
                const endPoint = path[currentPointIndex + 1];
                const deltaX = endPoint.x - startPoint.x;
                const deltaY = endPoint.y - startPoint.y;
                const segmentLength1 = Math.sqrt(deltaX * deltaX + deltaY * deltaY);
                if (currentLength + segmentLength1 >= targetLength) {
                    const t = (targetLength - currentLength) / segmentLength1;
                    lastPoint = {
                        x: startPoint.x + t * deltaX,
                        y: startPoint.y + t * deltaY
                    };
                    evenlySpacedPoints.push(lastPoint);
                    currentLength = targetLength;
                } else {
                    currentLength += segmentLength1;
                    lastPoint = null;
                    currentPointIndex++;
                }
            }
        }
        evenlySpacedPoints.push(path[path.length - 1]);
        return evenlySpacedPoints;
    }
